var $bm_rt;
var amp = effect('Amplitude')(1);
var freq = effect('Frequency')(1);
var off = effect('Time Offset')(1);
var off2 = effect('Value Offset')(1);
var menu = effect('Waveform')(1).value;
var t = $bm_sum($bm_sub(time, inPoint), off);
switch (menu) {
case 1:
    $bm_rt = $bm_sum($bm_sum(value, $bm_mul(Math.sin($bm_mul($bm_mul($bm_div($bm_mul(t, 1), freq), Math.PI), 2)), amp)), off2);
    break;
case 2:
    $bm_rt = $bm_sum($bm_sum(value, $bm_mul(Math.sign(Math.sin($bm_mul($bm_mul($bm_div($bm_mul(t, 1), freq), Math.PI), 2))), amp)), off2);
    break;
case 3:
    $bm_rt = $bm_sub($bm_sum($bm_sum(value, $bm_mul($bm_sub(freq, Math.abs($bm_sub($bm_mod($bm_mul(Math.abs(t), freq), $bm_mul(2, freq)), freq))), amp)), off2), amp);
    break;
case 4:
    $bm_rt = $bm_sum($bm_sum(value, $bm_mul($bm_div($bm_mod(t, freq), 2), amp)), off2);
    break;
}

